  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:24.473846\",\n\t\"name\": \"salmon-stream-reconnaissance-prince-william-sound-and-afognak-island\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In April of 1963, salmon stream improvement
  projects in Prince William Sound were visited. Objectives of the trip, from a fisheries
  standpoint, were as follows: (1) to make second examinations of salmon habitat improvement
  projects in Billie's Hole, Control Creek, Olsen Bay, and Shrode Creek, all in Prince
  William Sound; (2) to conduct a preliminary reconnaissance of salmon habitat improvement
  projects in Paul's Lake and Afognak Lake, both on Afognak Island; (3a) to collect
  and analyze gravel samples from Big Kitoi Creek (at Alaska Department of Fish and
  Game Kitoi Bay Research Station); (3b) to carefully examine Big Kitoi Creek from
  the standpoint of construction of an artificial spawning channel; and (4) to obtain
  from Alaska Department of Fish and Game personnel suggestions for additional salmon
  habitat improvement projects.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
